    [],nt"revision_timestamp": "2016-07-27T22:56:41.656977",nt"name": "trempealeau-national-wildlife-refuge-annual-narrative-report-calendar-year-1990",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Trempealeau
    National Wildlife Refuge outlines Refuge accomplishments during the 1990 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    compliance with environmental and cultural resource mandates and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, and safety is given. Habitat management is also covered;
    subjects include wetlands, grasslands, haying, fire management, and pest control.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    other migratory birds, game mammals, other resident wildlife, wildlife propagation,
    and marking and banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
    observation, and law enforcement. The equipment and facilities section of the report
    provides information about major maintenance, equipment utilization and replacement,
    and computer systems. Cooperative programs and items of interest are provided at
    the end. Photographs and Refuge brochures are attached.",nt"license_title":
